    public static long doAlgebra(ArrayList<String> op, ArrayList<Long> operand) {
        int i = 0;
        long result = operand.get(i++);
        while (i < operand.size()) {
            switch (op.get(i - 1)) {
                case "+":
                    result += operand.get(i++);
                    break;
                case "-":
                    result -= operand.get(i++);
                    break;
                case "*":
                    result *= operand.get(i++);
                    break;
                case "/":
                    result /= operand.get(i++);
                    break;
                case "**":
                    result = (long) Math.pow(result, operand.get(i++));
                    break;
            }
        }
        return result;

